	CREATE TABLE regions (
		id INT (11) UNSIGNED NOT NULL,
		name VARCHAR(25),
		PRIMARY KEY (id)
		);

	CREATE TABLE countries (
		id CHAR(2) NOT NULL,
		name VARCHAR(40),
		region INT (11) UNSIGNED NOT NULL,
		PRIMARY KEY (id),
		FOREIGN KEY (region) REFERENCES regions(id)
	);


	CREATE TABLE locations (
		id INT (11) UNSIGNED NOT NULL AUTO_INCREMENT,
		street_address VARCHAR(40),
		postal_code VARCHAR(12),
		city VARCHAR(30) NOT NULL,
		state_province VARCHAR(25),
		country CHAR(2) NOT NULL,
		PRIMARY KEY (id),
		FOREIGN KEY (country) REFERENCES countries(id)
		);


	CREATE TABLE jobs (
		id VARCHAR(10) NOT NULL,
		title VARCHAR(35) NOT NULL,
		min_salary DECIMAL(8, 0) UNSIGNED,
		max_salary DECIMAL(8, 0) UNSIGNED,
		PRIMARY KEY (id)
		);

	CREATE TABLE employees (
		id INT (11) UNSIGNED NOT NULL,
		first_name VARCHAR(20),
		last_name VARCHAR(25) NOT NULL,
		email VARCHAR(25) NOT NULL,
		phone_number VARCHAR(20),
		hire_date DATE NOT NULL,
		job VARCHAR(10) NOT NULL,
		salary DECIMAL(8, 2) NOT NULL,
		commission_pct DECIMAL(2, 2),
		manager INT (11) UNSIGNED,
		department INT (11) UNSIGNED,
		PRIMARY KEY (id),
		FOREIGN KEY (job) REFERENCES jobs(id),
		FOREIGN KEY (manager) REFERENCES employees(id)
		);
		
		
	CREATE TABLE departments (
		id INT (11) UNSIGNED NOT NULL,
		name VARCHAR(30) NOT NULL,
		manager INT (11) UNSIGNED,
		location INT (11) UNSIGNED,
		PRIMARY KEY (id),
		FOREIGN KEY (location) REFERENCES locations(id),
		FOREIGN KEY (manager) REFERENCES employees(id)
		);

	CREATE TABLE job_history (
		employee INT (11) UNSIGNED NOT NULL,
		start_date DATE NOT NULL,
		end_date DATE NOT NULL,
		job VARCHAR(10) NOT NULL,
		department INT (11) UNSIGNED NOT NULL,
		FOREIGN KEY (employee) REFERENCES employees(id),
		FOREIGN KEY (job) REFERENCES jobs(id),
		FOREIGN KEY (department) REFERENCES departments(id)
		);

	ALTER TABLE job_history ADD UNIQUE INDEX (
		employee,
		start_date
		);


		
